jp(a,b){var s=a.toLowerCase()
if(B.c.q(s,"\uc548\ub155")||B.c.q(s,"\ud558\uc774")||B.c.q(s,"\ubc18\uac00"))return A.ayx(b)
else if(B.c.q(s,"\ud798\ub4e4")||B.c.q(s,"\uc5b4\ub824")||B.c.q(s,"\uace0\ubbfc"))return A.ayv(b)
else if(B.c.q(s,"\uace0\ub9c8")||B.c.q(s,"\uac10\uc0ac"))return A.ayw(b)
else if(B.c.q(s,"\ubb34\uc11c")||B.c.q(s,"\uac81")||B.c.q(s,"\ub450\ub824"))return A.ayt(b)
else if(B.c.q(s,"\uc2f8\uc6c0")||B.c.q(s,"\uc804\ud22c")||B.c.q(s,"\uc2b9\ubd80"))return A.ays(b)
else return A.ayu(b)},
